Инструмент для отладки кодов баннерных мест Adfox

Инструмент, который показывает:
- список всех баннеров на странице;
- всю историю баннера, а также время, затраченное на его отображение;
- список параметров баннера: идентификаторы площадки, таргетинги, параметры показа рекламных мест и др.

*Инструмент не имеет отношения к команде разработки Adfox
